export default function Feadback({
  good,
  neutral,
  bad,
  total,
  positivePercentage,
}) {
  return (
    <div>
      <p>Good :{good}</p>
      <p>Neutral : {neutral}</p>
      <p>Bad :{bad}</p>
      <p>Total :{total}</p>
      <p>Positive feadback:{positivePercentage}</p>
    </div>
  );
}
